class MontantAvecTaxes {

    constructor(annee, montantSansTaxe, tps, tvq, montantAvecTaxes) {
        this.annee = annee;
        this.montantSansTaxe = montantSansTaxe;
        this.tps = tps;
        this.tvq = tvq;
        this.montantAvecTaxes = montantAvecTaxes
    }

    getMontantSansTaxe() {
        return this.montantSansTaxe
    }

    getTPS() {
        return Mathematique.calculTPS(this.montantSansTaxe)
    }

    getTVQ() {
        return Mathematique.calculTVQ(this.montantSansTaxe, this.annee)
    }

    getMontantAvecTaxe() {
        return this.montantAvecTaxes
    }

    getYear() {
        return this.annee
    }
}

export default MontantAvecTaxes;
